clear; close all; clc; 
%[text] The min and max thrust are defined for various uses.
rho1 = 4972; % [N]
rho2 = 13260; % [nN]

% Case 1
r0 = [1500 0 2000]';
rdot0 = [-75 0 100]';
rf = [0 0 0]';

% Case 2
% r0 = [1500 2500 2500]';
% rdot0 = [-75 40 100]';
% rf = [0 0 0]';
%[text] Next, the bounds for the golden section search are calculated, based on the initial altitude, velocity, and fuel-flow rate at minimum thrust. These are somewhat arbitrary and were found by experimentation, leading to quick convergence with a sufficiently large search space.
lb = 3 * (r0(1) / abs(rdot0(1))); % lower bound for optimal time search
ub = 2/3 * 400 / (4.53*10^-4 * rho1); % upper bound
tol = 5e-1; % max difference between x1 and x2 to iterate until

 % Case 1
[opt_t_f, optval, states, thrusts] = gss(lb, ub, tol, r0, rdot0, rf, 'Fuel'); %[output:403b612c]
% Case 2
% [opt_t_f, optval, states, thrusts] = gss(lb, ub, tol, r0, rdot0, rf, 'Landing Error');

delta_t = opt_t_f/size(states, 2);
N = size(states, 2) - 1;
tspan = 0:delta_t:N*delta_t;

x = states(1, :);
y = states(2, :);
z = states(3, :);
vx = states(4, :);
vy = states(5, :);
vz = states(6, :);
ux = thrusts(1, :);
uy = thrusts(2, :);
uz = thrusts(3, :);

gs_range = 0:1500:4500;

angle_above_surface = 90 + atan2d(vx, sqrt(vy.^2 + vz.^2));

thrust_mag = thrusts(4, :) .* exp(states(7, :));

thrust_angle = 90 - atan2d(ux, sqrt(uy.^2 + uz.^2));
thrust_angle_rate = gradient(thrust_angle, delta_t);
%[text] Below is a plot of the calculated optimal trajectory in 3D.
figure(1) %[output:56597887]
trajectory = tiledlayout(1, 1, "TileSpacing", "tight", "Padding", "tight"); %[output:56597887]
set(gcf, 'Position', [100 100 1000 600]) %[output:56597887]

nexttile %[output:56597887]
plot3(states(3,:), states(2,:), states(1,:), 'k', 'LineWidth', 1) %[output:56597887]
hold on; grid on; axis equal; %[output:56597887]
plot3(r0(3), r0(2), r0(1), 'o', 'MarkerSize', 6) %[output:56597887]
plot3(states(3, end), states(2, end), states(1, end), '.', 'MarkerSize', 18) %[output:56597887]
xlabel('$z$ [m]'); ylabel('$y$ [m]'); zlabel('$x$ [m]'); %[output:56597887]
xlim([0 4500]); ylim([-500 500]); zlim([0 1600]); %[output:56597887]
%[text] The following plots are created to match the presented results from the paper.
figure(2) %[output:18fb0203]
group_plot = tiledlayout(2, 4, "TileSpacing", "compact", "Padding", "compact"); %[output:18fb0203]
set(gcf, "Position", [100 100 1300 800]); %[output:18fb0203]

nexttile %[output:18fb0203]
plot(y, z, 'k', 'LineWidth', 1); %[output:18fb0203]
grid on; axis equal; box on; %[output:18fb0203]
xlabel('$y$ [m]'); ylabel('$z$ [m]'); %[output:18fb0203]
% ylim([0 4100]);
xlim([-1500 1500]); %[output:18fb0203]
title('Horizontal Plane Transfer'); %[output:18fb0203]

nexttile %[output:18fb0203]
plot(z, x, 'k', 'LineWidth', 1); %[output:18fb0203]
hold on; grid on; axis equal; box on; %[output:18fb0203]
plot(gs_range + z(end), sin(deg2rad(4)) * gs_range, 'r--', 'LineWidth', 1); %[output:18fb0203]
xlabel('$z$ [m]'); ylabel('$x$ [m]'); %[output:18fb0203]
ylim([0 6000]); %[output:18fb0203]
legend('Trajectory', 'Glideslope Constraint', 'Location', 'northeast'); %[output:18fb0203]
title('Vertical Plane Transfer'); %[output:18fb0203]

nexttile %[output:18fb0203]
hold on; grid on; box on; %[output:18fb0203]
plot(tspan, angle_above_surface, 'k', 'LineWidth', 1); %[output:18fb0203]
yline(4, 'r--', 'LineWidth', 1); %[output:18fb0203]
ylabel('Angle above surface [deg]'); xlabel('Time [s]'); %[output:18fb0203]
legend('Angle', 'Limit', 'Location', 'best'); %[output:18fb0203]

nexttile %[output:18fb0203]
plot(tspan, thrust_mag, 'black', 'LineWidth', 1); %[output:18fb0203]
hold on; grid on; box on; %[output:18fb0203]
yline(rho1, 'r--', 'LineWidth', 1); yline(rho2, 'r--', 'LineWidth', 1); %[output:18fb0203]
text(5, 1.07 * rho1, 'Min'); text(5, 0.97 * rho2, 'Max'); %[output:18fb0203]
xlabel('Time [s]'); ylabel('$T(t)$ [N]'); %[output:18fb0203]

nexttile %[output:18fb0203]
hold on; grid on; box on; %[output:18fb0203]
plot(tspan, x, 'r', 'LineWidth', 1); %[output:18fb0203]
plot(tspan, y, 'g', 'LineWidth', 1); %[output:18fb0203]
plot(tspan, z, 'b', 'LineWidth', 1); %[output:18fb0203]
xlabel('Time [s]'); ylabel('$r(t)$ [m]'); %[output:18fb0203]
legend('$x$', '$y$', '$z$', 'Location', 'northeast'); %[output:18fb0203]

nexttile %[output:18fb0203]
hold on; grid on; box on; %[output:18fb0203]
plot(tspan, vx, 'r', 'LineWidth', 1); %[output:18fb0203]
plot(tspan, vy, 'g', 'LineWidth', 1); %[output:18fb0203]
plot(tspan, vz, 'b', 'LineWidth', 1); %[output:18fb0203]
xlabel('Time [s]'); ylabel('$\dot{r}(t)$ [m/s]'); %[output:18fb0203]
legend('$\dot{x}$', '$\dot{y}$', '$\dot{z}$', 'Location', 'northeast'); %[output:18fb0203]

nexttile %[output:18fb0203]
hold on; grid on; box on; %[output:18fb0203]
plot(tspan, ux, 'r', 'LineWidth', 1); %[output:18fb0203]
plot(tspan, uy, 'g', 'LineWidth', 1); %[output:18fb0203]
plot(tspan, uz, 'b',  'LineWidth', 1); %[output:18fb0203]
xlabel('Time [s]'); ylabel('$u(t)$ [m/$s^2$]'); %[output:18fb0203]
legend('$u_x$', '$u_y$', '$u_z$', 'Location', 'southeast'); %[output:18fb0203]

nexttile %[output:18fb0203]
hold on; grid on; box on; %[output:18fb0203]
plot(tspan, thrust_angle, 'k', 'LineWidth', 1); %[output:18fb0203]
plot(tspan, thrust_angle_rate, 'k-.', 'LineWidth', 1); %[output:18fb0203]
xlabel('Time [s]'); ylabel('Angle [deg], Rate [deg/s]'); %[output:18fb0203]
legend('Thrust Angle', 'Angle Rate', 'Location', 'northwest'); %[output:18fb0203]
%[text] This function implements the golden section search used to solve for the optimal value. The lower/upper bounds, tolerance, and initial/final conditions are passed as input, along with a flag specifying whether to minimize fuel use or landing error. The golden section search uses the golden ratio (~0.618) to pick evaluation points, and then compares these values to set the new lower/upper bound for the next iteration. If CVX returns a 'Failed' or 'Infeasible' result, the optimal value is set much higher (around three orders of magnitude higher than a real expected value) to close off points higher/lower than the infeasible point. 'Inaccurate' solutions are allowed, and in testing, the optimal time never returned an inaccurate solution.
function [opt_t_f, optval, states, thrusts] = gss(lb, ub, tol, r0, rdot0, rf, flag)
    gr = (sqrt(5) - 1)/2;
    d = gr * (ub - lb);
    
    x1 = lb + d;
    x2 = ub - d;
    
    while d > tol
        [x1_status, x1_optval, ~] = powered_descent(r0, rdot0, rf, x1, flag);
        [x2_status, x2_optval, ~] = powered_descent(r0, rdot0, rf, x2, flag);
    
        if ~strcmp(x1_status, 'Solved')
            if strcmp(x1_status, 'Failed') || strcmp(x1_status, 'Infeasible')
                x1_optval = 10^6;
            end
        end
    
        if ~strcmp(x2_status, 'Solved')
            if strcmp(x2_status, 'Failed') || strcmp(x2_status, 'Infeasible')
                x2_optval = 10^6;
            end
        end
    
        formatSpec = 'lb = %.2f, x1 = %.2f (%.4f), x2 = %.2f (%.4f), ub = %.2f\n';
        fprintf(formatSpec, lb, x1, x1_optval, x2, x2_optval, ub);
    
        if x1_optval < x2_optval
            lb = x2;
            d = gr * (ub - lb);
            x2 = x1;
            x1 = lb + d;
        elseif x1_optval > x2_optval
            ub = x1;
            d = gr * (ub - lb);
            x1 = x2;
            x2 = ub - d;
        end
    
        opt_t_f = (x1 + x2)/2;
    end
    
    fprintf('----------------------------------------------------------------------\n')
    fprintf('Final Values\n');
    formatSpec = 'lb = %.2f, x1 = %.2f, x2 = %.2f, ub = %.2f\n';
    fprintf(formatSpec, lb, x1, x2, ub);
    
    [~, optval, states, thrusts] = powered_descent(r0, rdot0, rf, opt_t_f, flag);
    fprintf('Optimal t_f: %.2f [s], Optimal Value: %.4f', opt_t_f, optval);
end

